When a type is declared outside of Rune it is said to be external . External types are declared when setting up native modules. And Rune allows various levels of integration with the language. On the simplest level an external type is entirely opaque. Rune knows nothing about it except that it is a value bound to a variable. Below is the most simple example of an external type. It's implemented by deriving Any which can do a lot of heavy lifting for us. use rune::runtime::Vm;
