} With our newfound power we can now read external.value. pub fn main(external) { println!("{}", external.value);
} Setting the value is similarly simple. We simply mark the field with #[rune(set)]. #[derive(Debug, Any)]
struct External { #[rune(get, set)] value: u32,
} And now we can both read and write to external.value. pub fn main(external) { external.value = external.value + 1;
} Note: See the section about Field Functions for a complete reference of the available attributes.

