The following is the definition of the stringy_math! macro. Which is a macro that can be invoked on expressions. This relies heavily on a Rune-specific quote! macro . Which is inspired by its famed counterpart in the Rust world . A major difference with Rune quote! is that we need to pass in the MacroContext when invoking it. This is a detail which will be covered in one of the advanced sections. use crate as rune;
use crate::ast;
use crate::compile;
use crate::macros::{quote, MacroContext, TokenStream};
use crate::parse::Parser; /// Implementation of the `stringy_math!` macro.
#[rune::macro_]
pub fn stringy_math( cx: &mut MacroContext<'_, '_, '_>, stream: &TokenStream,
) -> compile::Result<TokenStream> { let mut parser = Parser::from_token_stream(stream, cx.input_span()); let mut output = quote!(0); while !parser.is_eof()? { let op = parser.parse::<ast::Ident>()?; let arg = parser.parse::<ast::Expr>()?; output = match cx.resolve(op)? { "add" => quote!((#output) + #arg), "sub" => quote!((#output) - #arg), "div" => quote!((#output) / #arg), "mul" => quote!((#output) * #arg), _ => return Err(compile::Error::msg(op, "unsupported operation")), } } parser.eof()?; Ok(output.into_token_stream(cx)?)
} A macro is added to a Module using the Module::macro_ function. pub fn module() -> Result<rune::Module, rune::ContextError> { let mut module = rune::Module::new(["test", "macros"]); module.macro_meta(stringy_math)?; Ok(module)
